import React, { Component } from 'react';

import axios from 'axios';

var url=`https://fakestoreapi.com/users`
class userdata extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
  
    

    componentDidMount() {axios.get(`${url}/${this.props.match.params.users}`)
    .then((apiresult)=>this.setState(apiresult.data))

    }

    
    render() {
        console.log(this.props.match.params.users)

        var{id, email, username, phone} = this.state
        return(
            <div>
              <h2>Selected Id Parameter For users only</h2>

              <table className ="w-25 mx-auto table table-bordered table-dark">
                  <tbody>
                      <tr>
                          <th>EMPID</th>
                          <td>{id}</td>
                      </tr>
                 
                      <tr>
                          <th>USERNAME</th>
                          <td>{username}</td>
                      </tr>


                      <tr>
                          <th>EMAIL</th>
                          <td>{email}</td>
                      </tr>

                      <tr>
                          <th>PHONE</th>
                          <td>{phone}</td>
                      </tr>
                  </tbody>
              </table>
               
            </div>
        );
    }
}



export default userdata;
